function Home() {
    return (
        <div>
            <h1> 일정관리 </h1>
        <img src={background} className='back' alt=''/>
        <article className='s-btn'>
          <Link to="/calendar" className='login'> 로그인 </Link>
        </article>
            <Calendar1 />
        </div>
    )
}

export default Home
